const Header = (props) => {
  return (
    <h1>{props.course}</h1>
  )
}

const Part = (props) => {
  return (
    <p>{props.text} {props.excerciseCount}</p>
  )
}

const Content = (props) => {
  return (
    <div>
      <Part text={p1} excerciseCount={p1Ex} />
      <Part text={p2} excerciseCount={p2Ex} />
      <Part text={p3} excerciseCount={p3Ex} />
    </div>
  )
}

const Total = (props) => {
  return (
    <div>
      <p>Number of exercises {props.exc1 + props.exc2 + props.exc3}</p>
    </div>
  )
}

const App = () => {
  const course = 'Half Stack application development'
  const part1 = 'Fundamentals of React'
  const exercises1 = 10
  const part2 = 'Using props to pass data'
  const exercises2 = 7
  const part3 = 'State of a component'
  const exercises3 = 14

  return (
    <div>
      <Header course={course} />
      <Content p1={part1} p2={part2} p3={part3} p1Ex={exercises1} p2Ex={exercises2} p3Ex={exercises3} />

      <p>Number of exercises {exercises1 + exercises2 + exercises3}</p>
    </div>
  )
}

export default App;
